"""# **DEFINITION OF Activation Functions**

#Sigmoid Activation function
![Screenshot 2025-02-09 152232.png](data:image/png;base64,)

#Output by Sigmoid Activation Function
"""

def sigmoid(x):
  return 1/(1+math.exp(-x))

sigmoid(0.8)

"""#Visualization in Sigmoid Activation"""

def plot_sigmoid():
    x=np.linspace(-10,10,100)
    y=1/(1+np.exp(-x))

    plt.plot(x,y)
    plt.xlabel('Input')
    plt.ylabel('Sigmoid Output')
    plt.title('Sigmoid Activation Function')
    plt.grid(True)
    plt.show()


plot_sigmoid()

"""#**relu function**
![Screenshot 2025-02-10 155029.png](data:image/png;base64,)

#Output by  relu Activation Function
"""

def relu(x):
  return max(0,x)

relu(78)

"""#**Visualization in Relu Activation**"""

def plot_relu():
   x=np.linspace(-10,10,100)
   relu=np.maximum(0,x)
   plt.plot(x,relu)
   plt.xlabel('Input')
   plt.ylabel('Relu Output')
   plt.title('Relu Activation Function')
   plt.grid(True)
   plt.show()

plot_relu()

"""#**Leaky Relu Activation**

![Screenshot 2025-02-10 155207.png](data:image/png;base64,)
"""

def leaky_relu(x,alpha=0.1):
    return max(x,alpha*x)

output=leaky_relu(-8)
print(output)

"""#**Visualizing Leaky Relu Function**"""

def plot_leaky():
   alpha=0.1
   x=np.linspace(-10,10,100)
   leaky=np.maximum(x,alpha*x)
   plt.plot(x,leaky)
   plt.xlabel('Input')
   plt.ylabel('Leaky Output')
   plt.title('Leaky Activation Function')
   plt.grid(True)
   plt.show()

plot_leaky()

"""#**TANH Activation**

![Screenshot 2025-02-10 155246.png](data:image/png;base64,)
"""

def tanh_activation(x):
    output=(np.exp(x)-np.exp(-x))/(np.exp(x)+np.exp(-x))
    return output

tanh_activation(1)

"""#**VISUALIZING Tanh Activation**"""

def plot_tanh():
    x=np.linspace(-10,10,100)
    tanh=np.tanh(x)
    plt.plot(x,tanh)
    plt.xlabel('Input')
    plt.ylabel('Tanh Output')
    plt.title('Tanh Activation Function')
    plt.grid(True)
    plt.show()

plot_tanh()

"""#**SOFTMAX ACTIVATION FUNCTION**

![Screenshot 2025-02-10 155334.png](data:image/png;base64,)
"""

def softmax_act(x):
    e_x=np.exp(x-np.max(x))
    return e_x/(np.sum(e_x,axis=0))

x=np.array([8,7,3])
softmax_act(x)

