"""* As we are specifying how are model will learn thru loss function

# **Sparse_categorical_entropy:**
* It is type of loss function
* Used in Multi class classification where labels are integers (01,2,N-1) other than [1,0,0] ....
* We use sparse_categorical_entropy when the output layer uses Softmax activation function and labels are encoded as 0,1,2,...

![Screenshot 2025-02-09 105522.png](data:image/png;base64,)

Where:
^y= Predicted probability of the correct class.

 * The loss penalizes wrong predictions by taking the negative log of the predicted probability.

 ''LESS LOSS MEANS BETTER PREDICTION''

# **EPOCHS:**
* A series of models were trained over 50 epochs, with varying activation functions observed for training time and accuracy.

#**VERBOSE**
* The 'Verbose' parameter controls how much information is displayed during training.

![Screenshot 2025-02-09 130144.png](data:image/png;base64,)
"""

def build_train_model(activation_function):
    model=Sequential([
        Input(shape=(4,)), #Input layer where it accepts 4 features
        Dense(32,activation=activation_function), #1st hidden layer WITH '32' NEURONS
        Dense(16,activation=activation_function), #2nd hidden layer WITH '16' NEURONS
        Dense(8,activation=activation_function), #3rd hidden layer with '8' NEURONS
        Dense(4,activation=activation_function), #4th hidden layer with '4' NEURONS
        Dense(3,activation='softmax')#Output layer (Softmax Activation fuction applied)
        #3 classes:Setosa,Versicolor,Virginica
    ])

    model.compile(optimizer=Adam(learning_rate=0.001),loss= 'sparse_categorical_crossentropy' ,metrics=['accuracy'])#
    #loss (sparse_categorical_crossentropy used because the output has multiple classes)

    return model

"""# **ACTIVATION FUNCTIONS**
* We defined activation functions:
 * 'SIGMOID'
 * 'relu'
 * 'Leaky relu'
 * 'Tanh'

* The Sigmoid activation function is characterized by its smooth output transitioning between 0 and 1.

* The Leaky ReLU activation function allows a small, non-zero, constant gradient when the unit is inactive, addressing the "dying ReLU" problem.

* The Tanh activation function outputs values between -1 and 1, helping with centered data for gradient descent.

#**SIGMOID ACTIVATION**
"""

Sigmoid_model=build_train_model('sigmoid')

"""# **Sigmoid Model training**"""

start_time=time.time()
sigmoid_history=Sigmoid_model.fit(X_train,Y_train,epochs=50,verbose=1,validation_data=(X_test,Y_test))
